import styles from "./Footer.module.css";

function Footer() {
  return (
    <div className={styles.footer_container}>
      <p>
        &copy; 2024 Desenvolvido por <a href="">Nayara Karine</a>
      </p>
    </div>
  );
}

export default Footer;
